import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className= "App-top">
          <h1> Simple OKRs </h1>
        </div>
        <div className="Content">
        <h1> Manage your team's OKRs </h1>
        <p1> Achieve your goals with Simple OKR, a lightweight and free slack app for OKRs.  </p1>
        <a href="https://slack.com/oauth/v2/authorize?client_id=875210016705.885000441780&scope=calls:read,calls:write,channels:read,chat:write,commands,dnd:read,groups:read,im:history,im:read,im:write,mpim:history,mpim:read,mpim:write,remote_files:read,remote_files:share,remote_files:write,team:read,users:read,users:read.email,users:write&user_scope=chat:write">
          <img padding-top= "200" alt="Add to Slack" height="40" width="139" src="https://platform.slack-edge.com/img/add_to_slack.png" srcset="https://platform.slack-edge.com/img/add_to_slack.png 1x, https://platform.slack-edge.com/img/add_to_slack@2x.png 2x"></img>
        </a>
      </div>
      </header>
    </div>
  );
}

export default App;
